import "./App.css";

function App() {
  return (
    <div className="app">
      <div className="header">
        <h1>Hertz - Digital Mesh</h1>
        <img src={logo} />
      </div>
      <div className="api-connection">
        <h1>API Connection</h1>
      </div>
    </div>
  );
}

export default App;
